    "2016-04-19T02:27:59.044621",nt"name": "plus-1-funding-source",nt"isopen":
    false,nt"url": null,nt"notes": "The City of Austin's Plus 1 Fund provides
    emergency utility bill financial assistance to customers experiencing extreme hardships
    such as medical illness or sudden job loss. In 2009 the City of Austin doubled to
    $300,000 the amount of funding made available annually for this program. Beginning
    in fiscal year 2009, City of Austin employees were given the option to donate to
    the Plus 1 Fund through the City's annual Combined Charities Campaign which raises
    money for local and regional charitable groups. Additionally, utility customers
    have the option to donate to the Plus 1 Fund when they make their monthly utility
    bill payments. Plus 1 funding is distributed to customers by more than a dozen social
    service agencies including Travis County Family Services and Meals on Wheels.",nt"license_title":
